// ─── Photo component with fallback ──────────────────────────────────────────
const PhotoBg = ({ src, children, style, fallbackColor, overlayGradient }) => (
  <div style={{ position: "relative", overflow: "hidden", background: fallbackColor || `linear-gradient(135deg, ${theme.navy}, ${theme.blue})`, ...style }}>
    <img src={src} alt=""
      style={{ position: "absolute", inset: 0, width: "100%", height: "100%", objectFit: "cover", opacity: 0.85 }}
      onError={e => { e.target.style.display = "none"; }} />
    <div style={{ position: "absolute", inset: 0, background: overlayGradient || "linear-gradient(to bottom, rgba(0,0,0,0.15) 0%, rgba(0,0,0,0.5) 100%)" }} />
    <div style={{ position: "relative", zIndex: 1 }}>{children}</div>
  </div>
);

// ─── Reusable Components ────────────────────────────────────────────────────
const Badge = ({ children, color = theme.blue, bg, small }) => (
  <span style={{ display: "inline-flex", alignItems: "center", padding: small ? "2px 8px" : "4px 12px", borderRadius: 100, fontSize: small ? 10 : 11, fontWeight: 600, letterSpacing: 0.3, background: bg || `${color}18`, color }}>{children}</span>
);

