// ─── Trips Screen ───────────────────────────────────────────────────────────
const TripsScreen = ({ onSelectTrip, favorites, onToggleFavorite }) => {
  const [filter, setFilter] = useState("all");
  const [sortBy, setSortBy] = useState("price-low");
  const categories = [{ id: "all", label: "All" }, { id: "favorites", label: "Saved" }, { id: "inshore", label: "Inshore" }, { id: "offshore", label: "Offshore" }, { id: "multi-day", label: "Multi-Day" }, { id: "cruise", label: "Cruises" }];
  let filtered = filter === "favorites" ? TRIPS.filter(t => favorites.has(t.id)) : filter === "all" ? TRIPS : TRIPS.filter(t => t.category === filter);
  if (sortBy === "price-low") filtered = [...filtered].sort((a, b) => a.price - b.price);
  if (sortBy === "price-high") filtered = [...filtered].sort((a, b) => b.price - a.price);
  if (sortBy === "duration") filtered = [...filtered].sort((a, b) => parseInt(a.duration) - parseInt(b.duration));

  return (
    <div>
      <WaveBackground height={140}>
        <div style={{ padding: "20px 20px 50px" }}>
          <div style={{ fontSize: 28, fontWeight: 800, color: theme.white, letterSpacing: -0.5 }}>Fishing Trips</div>
          <div style={{ fontSize: 14, color: "rgba(255,255,255,0.7)", marginTop: 4 }}>{filtered.length} trips available</div>
        </div>
      </WaveBackground>
      <div style={{ display: "flex", gap: 6, padding: "0 16px", marginTop: -20, marginBottom: 16, position: "relative", zIndex: 2 }}>
        {categories.map(c => (
          <button key={c.id} onClick={() => setFilter(c.id)} style={{ flex: 1, padding: "8px 0", borderRadius: 100, border: "none", background: filter === c.id ? theme.blue : theme.white, color: filter === c.id ? theme.white : theme.gray500, fontSize: 12, fontWeight: 600, cursor: "pointer", whiteSpace: "nowrap", boxShadow: filter === c.id ? `0 4px 12px ${theme.blue}30` : "0 2px 8px rgba(0,0,0,0.06)", transition: "all 0.2s", textAlign: "center" }}>{c.label}</button>
        ))}
      </div>
      <div style={{ display: "flex", gap: 6, padding: "0 20px", marginBottom: 16, flexWrap: "wrap" }}>
        {[{ id: "price-low", label: "Price: Low" }, { id: "price-high", label: "Price: High" }, { id: "duration", label: "Duration" }].map(s => (
          <button key={s.id} onClick={() => setSortBy(s.id)} style={{ padding: "5px 12px", borderRadius: 8, border: `1px solid ${sortBy === s.id ? theme.blue : theme.gray200}`, background: sortBy === s.id ? `${theme.blue}08` : "transparent", color: sortBy === s.id ? theme.blue : theme.gray400, fontSize: 11, fontWeight: 600, cursor: "pointer" }}>{s.label}</button>
        ))}
      </div>
      <div style={{ padding: "0 20px", display: "flex", flexDirection: "column", gap: 12 }}>
        {filtered.length === 0 && (
          <div style={{ textAlign: "center", padding: "40px 20px" }}>
            <Icons.Heart size={36} color={theme.gray300} />
            <div style={{ fontSize: 16, fontWeight: 700, color: theme.navy, marginTop: 12 }}>{filter === "favorites" ? "No saved trips yet" : "No trips match this filter"}</div>
            <div style={{ fontSize: 13, color: theme.gray400, marginTop: 6 }}>{filter === "favorites" ? "Tap the heart icon on any trip to save it here." : "Try a different filter to find trips."}</div>
          </div>
        )}
        {filtered.map(trip => (
          <Card key={trip.id} onClick={() => onSelectTrip(trip)} style={{ display: "flex", gap: 14, padding: 0, overflow: "hidden", position: "relative" }}>
            <div style={{ width: 90, minHeight: 100, flexShrink: 0, position: "relative", overflow: "hidden" }}>
              <img src={trip.photo} alt="" style={{ position: "absolute", inset: 0, width: "100%", height: "100%", objectFit: "cover" }} onError={e => { e.target.style.display = "none"; e.target.parentElement.style.background = `linear-gradient(135deg, ${theme.navy}, ${theme.blue})`; }} />
              <div style={{ position: "absolute", inset: 0, background: `linear-gradient(135deg, ${theme.navy}, ${theme.blue})`, zIndex: -1, display: "flex", alignItems: "center", justifyContent: "center" }}>
                <FishIcon type={trip.illustration} size={44} />
              </div>
            </div>
            <div style={{ flex: 1, minWidth: 0, padding: "12px 14px 12px 0" }}>
              <div style={{ display: "flex", justifyContent: "space-between", alignItems: "flex-start" }}>
                <div style={{ fontSize: 15, fontWeight: 700, color: theme.navy, lineHeight: 1.2, flex: 1 }}>{trip.name}</div>
                <div onClick={e => { e.stopPropagation(); onToggleFavorite(trip.id); }} style={{ cursor: "pointer", padding: 4, marginTop: -2 }}>
                  <Icons.Heart size={18} color={favorites.has(trip.id) ? "#FF3B30" : theme.gray300} filled={favorites.has(trip.id)} />
                </div>
              </div>
              <div style={{ fontSize: 12, color: theme.gray400, marginTop: 4 }}>{trip.vessel} · {trip.departure}</div>
              <div style={{ display: "flex", gap: 10, marginTop: 8, alignItems: "center" }}>
                <span style={{ fontSize: 11, color: theme.gray500, display: "flex", alignItems: "center", gap: 3 }}><Icons.Clock size={12} />{trip.duration}</span>
                <span style={{ fontSize: 11, color: theme.gray500, display: "flex", alignItems: "center", gap: 3 }}><Icons.Users size={12} />{trip.capacity} max</span>
              </div>
              <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginTop: 8 }}>
                <span style={{ fontSize: 20, fontWeight: 800, color: theme.blue }}>${trip.price}</span>
                <Badge color={trip.category === "multi-day" ? theme.gold : trip.category === "offshore" ? theme.blue : theme.success} small>{trip.category}</Badge>
              </div>
            </div>
          </Card>
        ))}
      </div>
      <div style={{ height: 20 }} />
    </div>
  );
};

